  render(){
    return <h1>this is component</h1>
  }
}

function Cal(props){
  let f=1;
  for(let i=1;i<=props.value;i++){
    f=f*i;
  }
  return <h1>factorial of {props.value} = {f}</h1>
}
function App() {
  return (
    <div className="App">

      <Cal value="5"/>
